async function checkPassword(){
var pw=document.getElementById("pwInput").value;
var buf=new TextEncoder().encode(pw);
var hashBuf=await crypto.subtle.digest("SHA-256",buf);
var hex=Array.from(new Uint8Array(hashBuf)).map(b=>b.toString(16).padStart(2,"0")).join("");
if(hex===HASH){
var html=atob(ENCODED);
document.open();document.write(html);document.close();
}else{
var el=document.getElementById("pwInput");
el.classList.add("shake");
document.getElementById("pwError").textContent="Incorrect password";
setTimeout(function(){el.classList.remove("shake")},400);
}
return false;
}
